import React, { Component } from "react";
import {
    Container, Row, Col
} from 'react-bootstrap';
import logo from './images/Logo/logo_big.png';
import {
    Switch,
    Route,
    Link,
    BrowserRouter
} from "react-router-dom";
import PrivacyPolicy from "./PrivacyPolicy";

class Footer extends Component {


    render() {


        return (
            <BrowserRouter>
            <Switch>
            <div className="component_content footer">
                <Container>
                    <Row>
                        <Col>
                            <div>
                                <img src={logo} alt="Logo" class="d-block mx-auto img-fluid"/>
                                <a href="/privacypolicy" class="text-blue">Privacy Policy | </a>
                                        <Route path="/privacypolicy"><PrivacyPolicy /></Route>
                                        <Link to="/privacypolicy"><PrivacyPolicy /></Link>
                                <a href="/cookiepolicy" class="text-blue">Cookie Policy | </a>
                                <a href="/termsandconditions" class="text-blue">Terms and Conditions</a>
                                    <p><small>Copyright Â© 2019 YMP. All Rights Reserved</small></p>
                                </div>
                        </Col>
                    </Row>
                </Container>
            </div>
            </Switch>
            </BrowserRouter>
        );
    }
}

export default Footer;
